import axios from 'axios';

// Configuración global de Axios
axios.defaults.headers.common['Access-Control-Allow-Origin'] = '*';
axios.defaults.headers.common['Access-Control-Allow-Methods'] = 'GET, POST, PUT';
axios.defaults.headers.common['Access-Control-Allow-Headers'] = 'Origin, Content-Type, X-Auth-Token';


const BASE_URL = "http://localhost:8000/get_data_saved/idStock";

const getPriceStock = async (idStock) => {

    console.log(BASE_URL.replace('idStock', idStock))
    let data = axios({
        method: 'get',
        url: BASE_URL.replace('idStock', idStock),
        responseType: 'json'
    })
    return data;
} 

export default getPriceStock;
